    [],nt"num_tags": 5,nt"name": "refuge-narrative-report-may-through-august-1955-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from May through August of 1955. The report begins by summarizing
    the weather conditions and water conditions during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    and mammals- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    Refuge visitors, Refuge participation, hunting, and fishing. Items of interest are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
